import './Immagine.css'

function Immagine(){
    return(
        <body>
            <h3>Generazione immagini</h3>
            <img src='https://dummyimage.com/600x400/ff0000/000000.png&text=Immagine.'></img>
            <table>
                <thead>
                    <tr>Descrizione</tr>
                </thead>
            </table>
        </body>
    );
}

export default Immagine;
